// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract Struct5Lesson {
    struct Payment {
        uint amount;
        uint timestamp;
        address from;
    }

    struct Balance {
        uint totalPayments;
        mapping(uint => Payment) payments;
    }

    mapping(address => Balance) public balances;

    function pay() public payable {
        balances[msg.sender].totalPayments++;
    }
}

